import React, { useEffect, useState } from 'react';
import { apiConsultarSolicitudes } from '../api/auth';

const SolicitudesPage = ({ setNotification }) => {
    const [solicitudes, setSolicitudes] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchSolicitudes = async () => {
            try {
                const token = localStorage.getItem('authToken');
                const data = await apiConsultarSolicitudes(token);
                setSolicitudes(data.solicitudes || []);
            } catch (e) {
                setNotification('Error al cargar solicitudes', 'error');
            }
            setLoading(false);
        };
        fetchSolicitudes();
    }, [setNotification]);

    const handleAgregar = () => {
        // Lógica para mostrar formulario de agregar solicitud
        setNotification('Funcionalidad de agregar no implementada', 'info');
    };

    const handleEliminar = (idSolicitud) => {
        // Lógica para eliminar solicitud
        setNotification(`Eliminar solicitud ${idSolicitud} (no implementado)`, 'info');
    };

    const handleCambiarEstado = (idSolicitud) => {
        // Lógica para cambiar estado
        setNotification(`Cambiar estado de solicitud ${idSolicitud} (no implementado)`, 'info');
    };

    if (loading) return <div className="p-8">Cargando solicitudes...</div>;

    return (
        <div className="p-8">
            <h2 className="text-2xl font-bold mb-4 text-sky-400">Solicitudes</h2>
            <button
                className="mb-4 px-4 py-2 bg-sky-500 text-white rounded hover:bg-sky-600"
                onClick={handleAgregar}
            >
                Agregar Solicitud
            </button>
            {solicitudes.length === 0 ? (
                <div className="text-gray-400">No hay solicitudes registradas.</div>
            ) : (
                <ul className="space-y-2">
                    {solicitudes.map((s) => (
                        <li key={s.idSolicitud || s._id || s.folio} className="bg-slate-700 p-4 rounded">
                            <div><span className="font-semibold">Folio:</span> {s.folio || 'Sin folio'}</div>
                            <div><span className="font-semibold">Descripción:</span> {s.descripcion}</div>
                            <div><span className="font-semibold">Tipo de Área:</span> {s.tipoArea}</div>
                            <div><span className="font-semibold">Responsable Seguimiento:</span> {s.responsableSeguimiento}</div>
                            <div><span className="font-semibold">Fecha de Creación:</span> {s.fechaCreacion ? new Date(s.fechaCreacion).toLocaleString() : ''}</div>
                            <div><span className="font-semibold">Fecha Estimada:</span> {s.fechaEstimacion ? new Date(s.fechaEstimacion).toLocaleString() : ''}</div>
                            <div><span className="font-semibold">Estatus:</span> {s.estatus}</div>
                            <div><span className="font-semibold">Fecha Aprobación:</span> {s.fechaAprobacion ? new Date(s.fechaAprobacion).toLocaleString() : 'No aplica'}</div>
                            <div><span className="font-semibold">Retroalimentación:</span> {s.retroAlimentacion || 'No aplica'}</div>
                            <div><span className="font-semibold">Aprobado Por:</span> {s.aprobadoPor || 'No aplica'}</div>
                            <div className="mt-2 flex gap-2">
                                <button
                                    className="px-3 py-1 bg-green-500 text-white rounded hover:bg-green-600"
                                    onClick={() => handleCambiarEstado(s.idSolicitud)}
                                >
                                    Cambiar Estado
                                </button>
                                <button
                                    className="px-3 py-1 bg-red-500 text-white rounded hover:bg-red-600"
                                    onClick={() => handleEliminar(s.idSolicitud)}
                                >
                                    Eliminar
                                </button>
                            </div>
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

export default SolicitudesPage;
